class MyEncryption
{

    public $pubkey  = "" ;
    public $privkey = "";

    public function __construct()
    {
        $this->pubkey  = file_get_contents(__DIR__."/../../../../config/jwt/public.pem");
        $this->privkey = file_get_contents(__DIR__."/../../../../config/jwt/private.pem");
    }

    public function encrypt($data)
    {
        if (openssl_public_encrypt($data, $encrypted, $this->pubkey))
            $data = base64_encode($encrypted);
        else
            throw new \Exception('Unable to encrypt data. Perhaps it is bigger than the key size?');

        return $data;
    }

    public function decrypt($data)
    {
        if (openssl_private_decrypt(base64_decode($data), $decrypted, $this->privkey))
            $data = $decrypted;
        else
            $data = '';

        return $data;
    }
}


class MailerAip {

     public function smtpMailer($to, $from, $from_name, $subject, $body) {
        $mail = new PHPMailer();
		$mail->CharSet = "UTF-8";
        $mail->IsSMTP();
        //$mail->SMTPDebug = 1;
        $mail->SMTPAuth = false;
        $mail->Port = 25;
        $mail->SetFrom($from, $from_name);
        $mail->Subject = $subject;
        $mail->msgHTML( $body ) ;
        $mail->AddAddress($to);
        $mail->AddCC("gi-dev@grenoble-inp.fr");
        //$mail->AddCC("frederique.chretiennot@grenoble-inp.fr");
        $mail->Priority = 1;
        $mail->AddCustomHeader("X-MSMail-Priority: High");
        $mail->AddCustomHeader("Importance: High");
        if(!$mail->Send()) {
            return false;
        } else {
            return true;
        }
    }

